class Test(unittest.TestCase):


    def testDecodeSyntheticWord_Empty_expectEmpty(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('')
        
        #assert
        assertThat( result ).is_empty()
        
    def testDecodeSyntheticWord_WordSmallA_expectTranslation_0(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('a')

        #assert
        assertThat( result ).matches('0')
        
    def testDecodeSyntheticWord_WordSmallB_expectTranslation_1(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('b')

        #assert
        assertThat( result ).matches('1')

    def testDecodeSyntheticWord_WordSmallBA_expectTranslation_10(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('ba')

        #assert
        assertThat( result ).matches('10')
        
    def testDecodeSyntheticWord_WordSmallJJ_expectTranslation_99(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('jj')

        #assert
        assertThat( result ).matches('99')

    def testDecodeSyntheticWord_WordSmallBCDEFGHIJA_expectTranslation_1234567890(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result = embedding.decode_synthetic_word('bcdefghija')

        #assert
        assertThat( result ).matches('1234567890')

    def testDecodeEmbeddingLine_TheUnknownEmbedding_expectDecodedIndexIsZero(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result,_ = embedding.decode_embedding_line(EMBEDDING_OF_UNKNOWN)

        #assert
        assertThat( result ).is_zero()
    
    def testDedodeEmbeddingLine_TheUnknownEmbedding_expectHasOneDimension(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        _,result = embedding.decode_embedding_line(EMBEDDING_OF_UNKNOWN)

        #assert
        assertThat( result ).has_dimensionality(1)
    
    
    def testDedodeEmbeddingLine_TheUnknownEmbedding_expectSizeOfEmbeddigIs512(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        _,result = embedding.decode_embedding_line(EMBEDDING_OF_UNKNOWN)

        #assert
        assertThat( result ).is_nuple(512)

    def testDecodeEmbeddingLine_TheUnknownEmbedding1_expectDecodedIndexIsNotZero(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        result,_ = embedding.decode_embedding_line(EMBEDDING_OF_47)

        #assert
        assertThat( result ).is_not_zero()
    
    def testDedodeEmbeddingLine_TheUnknownEmbedding1_expectHasOneDimension(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        _,result = embedding.decode_embedding_line(EMBEDDING_OF_47)

        #assert
        assertThat( result ).has_dimensionality(1)
    
    
    def testDedodeEmbeddingLine_TheUnknownEmbedding1_expectSizeOfEmbeddigIs512(self):
        # arrange
        embedding = dl4jembeddings.DL4jModifiedEmbeddings()
        
        #act
        _,result = embedding.decode_embedding_line(EMBEDDING_OF_47)

